                Registro_Usuario = x.Registro_Usuario,
                Turno_Estado = x.Turno_Estado,
                Turno_Estudios_Iniciado_Cantidad = x.Turno_Estudios_Iniciado_Cantidad.Value,
                Turno_Fecha = x.Turno_Fecha.Value,
                Turno_Razon_Inactivo = x.Turno_Razon_Inactivo                    }).ToList();

            return result;
        }
	} 
} 


